import React from "react";
import { useHistory } from "react-router-dom";

const Details = () => {
  const history = useHistory();
  return (
    <div className="w-full ml-4 block mt-24">
      <div className="w-full shadow-md">
        <i
          className="fa fa-angle-left text-3xl text-green-600 m-1 font-bold cursor-pointer px-2 py-1"
          onClick={() => history.goBack()}
          title="go back"
        ></i>
      </div>
      <div className="w-full md:w-2/3 lg:w-1/2 m-auto bg-gray-100 mt-1 h-full pb-32 pl-4">
        <div className="font-semibold">Username</div>
        <div className="flex">
          <div className="w-32 text-gray-600 text-right pr-4">Full Name</div>
          <div className="ml-1">Abdulai Nuru-deen</div>
        </div>
        <div className="flex">
          <label className="max-w-32">Email</label>
          <div className="ml-1">Abdulai Nuru-deen</div>
        </div>
      </div>
    </div>
  );
};

export default Details;
